import React, { useState, useEffect } from "react";
import axios from "axios";

const Booking = () => {
  const [paymentDetails, setPaymentDetails] = useState({});
  const [isDataAvailable, setIsDataAvailable] = useState(true);
  const [loading, setLoading] = useState(true);
  const [newStatus, setNewStatus] = useState("");

  useEffect(() => {
    const fetchPaymentData = async () => {
      try {
        const response = await axios.get(
          "http://localhost:8000/medical_store_app/payment_details/"
        );
        if (response.data.paymentDetails && response.data.paymentDetails.length > 0) {
          setPaymentDetails(response.data.paymentDetails[0]);
          setIsDataAvailable(true);
        } else {
          setIsDataAvailable(false);
        }
      } catch (error) {
        console.error("Error fetching payment details:", error);
        setIsDataAvailable(false);
      } finally {
        setLoading(false);
      }
    };

    fetchPaymentData();
  }, []);
  const updatePaymentStatus = async (paymentId, status) => {
    try {
      const response = await axios.put(
        `http://localhost:8000/medical_store_app/payment_details/${paymentId}/update_status/`,
        { payment_status: status },
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem("token")}`, 
          },
        }
      );
      console.log("Updated payment status:", response.data);
      setPaymentDetails(response.data); 
    } catch (error) {
      console.error("Error updating payment status:", error);
    }
  };

  const handleStatusChange = (e) => {
    setNewStatus(e.target.value);
  };

  const handleSubmit = () => {
    if (newStatus) {
      updatePaymentStatus(paymentDetails.razorpay_payment_id, newStatus);
    }
  };

  return (
    <div style={styles.containerStyle}>
      <h1 style={styles.titleStyle}>Booking Details</h1>
      {loading ? (
        <p>Loading...</p>
      ) : !isDataAvailable ? (
        <p style={styles.errorStyle}>No booking details available.</p>
      ) : (
        <div>
          <table style={styles.tableStyle}>
            <thead>
              <tr>
                <th style={styles.headerStyle}>Field</th>
                <th style={styles.headerStyle}>Value</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td style={styles.cellStyle}>Payment ID</td>
                <td style={styles.cellStyle}>{paymentDetails.razorpay_payment_id}</td>
              </tr>
              <tr>
                <td style={styles.cellStyle}>Order ID</td>
                <td style={styles.cellStyle}>{paymentDetails.razorpay_order_id}</td>
              </tr>
              <tr>
                <td style={styles.cellStyle}>Amount</td>
                <td style={styles.cellStyle}>{paymentDetails.amount}</td>
              </tr>
              <tr>
                <td style={styles.cellStyle}>Signature</td>
                <td style={styles.cellStyle}>{paymentDetails.razorpay_signature}</td>
              </tr>
              <tr>
                <td style={styles.cellStyle}>Created At</td>
                <td style={styles.cellStyle}>{paymentDetails.created_at}</td>
              </tr>
              <tr>
                <td style={styles.cellStyle}>Payment Status</td>
                <td style={styles.cellStyle}>
                  {paymentDetails.payment_status}
                </td>
              </tr>
            </tbody>
          </table>

          {paymentDetails.payment_status === "pending" && (
            <div>
              <label>Update Payment Status: </label>
              <select
                value={newStatus}
                onChange={handleStatusChange}
                style={styles.selectStyle}
              >
                <option value="">Select Status</option>
                <option value="completed">Completed</option>
                <option value="failed">Failed</option>
                <option value="pending">Pending</option>
              </select>
              <button onClick={handleSubmit} style={styles.buttonStyle}>
                Update Status
              </button>
            </div>
          )}
        </div>
      )}
    </div>
  );
};

const styles = {
  containerStyle: {
    margin: "50px auto",
    padding: "20px",
    maxWidth: "800px",
    border: "1px solid #ddd",
    borderRadius: "8px",
    backgroundColor: "#f9f9f9",
  },
  titleStyle: {
    textAlign: "center",
    marginBottom: "20px",
  },
  tableStyle: {
    width: "100%",
    borderCollapse: "collapse",
  },
  headerStyle: {
    borderBottom: "2px solid #000",
    padding: "10px",
    textAlign: "left",
    fontWeight: "bold",
  },
  cellStyle: {
    padding: "10px",
    borderBottom: "1px solid #ddd",
  },
  errorStyle: {
    textAlign: "center",
    color: "red",
    fontSize: "18px",
  },
  selectStyle: {
    padding: "5px",
    marginRight: "10px",
  },
  buttonStyle: {
    padding: "10px 15px",
    backgroundColor: "#4CAF50",
    color: "white",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
  },
};

export default Booking;
